***
The GraphQl query for this endpoint is:
``` graphql
query GetProjects($where: projects_bool_exp! = {}, $orderBy: [projects_order_by!] = []) {
  projects(where: $where, order_by: $orderBy) {
    id
    name
    userId
    linkedinId
    createdAt
    updatedAt
    deletedAt
    colorId
    presetId
    isMadeForRecruitment
    isMadeForSales
    groupId
    group {
      id
      name
    }
    user {
      displayName
      email
      id
      disabled
    }
    assignees(where: {deletedAt: {_is_null: true}, user: {disabled: {_eq: false}}}) {
      user {
        displayName
        email
        id
      }
    }
    linkedinContractId
    statusId
    ignoreHistoryBeforeProjectCreatedAt
    companyId
    externalId
    referenceId
    linkedinIdType
    files(order_by: {createdAt: asc}, where: {deletedAt: {_is_null: true}}) {
      fileId
      createdAt
      updatedAt
      file {
        id
        name
        size
        mimeType
      }
    }
    status {
      title
      color {
        id
        name
      }
      isAuto
      id
    }
    company {
      id
      description
      companyPublicData {
        id
        name
        tagline
        description
        foundedAt
        linkedinEmployeeCount
        linkedinEmployeeStartCount
        linkedinEmployeeEndCount
        linkedinUrl
        website
        image {
          publicUrl
        }
      }
    }
    fieldsValues {
      id
      field {
        id
        type
        name
        purpose
      }
      fieldValue {
        id
        name
        technicalValue
      }
      location {
        id
        search
        locality
        postalCode
        administrativeAreaLevel2
        administrativeAreaLevel1
        countryName
        countryShortName
        formattedAddress
      }
      value
    }
    color {
      id
      name
    }
    jobBoardsOffers {
      id
    }
    projectJobBoards(where: {deletedAt: {_is_null: true}}) {
      id
      createdAt
      updatedAt
      deletedAt
      enabledAt
      projectId
      jobBoard {
        id
        canonicalName
      }
    }
    profilesCountPerStatusGroup(where: {status: {id: {_is_null: false}}}, order_by: {status: {order: asc}}) {
      status {
        id
        title
        isHidden
        isAuto
        order
        parentId
        color {
          id
          name
        }
      }
      count
    }
    __typename
  }
}
```
